import { Injectable } from '@angular/core';
import { Place } from './places.model';

@Injectable({
  providedIn: 'root'
})
export class PlacesService {
  private _places: Place[] = [
  new Place(
    'p1','Goa','Beaches, Clubs, Chruches and many more..','data:image/jpeg;base64,',10000
  ),
  new Place('p2','Hoonavar','The Untouched Heaven..','data:image/jpeg;base64,',8000),
  new Place('p3','Matheran','The Winters Romance..','data:image/jpeg;base64,',5000)
];
  constructor() { }

  get places() {
    return [...this._places]
  }

  getPlaces(id: string) {
    return {...this._places.find(p => p.id === id)};
  }
}
